import { baseURL } from "./OpenAI";
import React from "react";
import axios from "axios";

class OpenAINLP extends React.Component {
    constructor(props) {
        super(props);
        this.state = {
            urlBase: baseURL,
            openAIresponse: {
                names: [],
                specie: "",
            },
        };

    }

    GetPetNames(specieInput) {
        this.state.petSpecie = specieInput;
        axios
         .post(this.state.urlBase + "nlp-pet-name/specie/" + this.state.petSpecie)
         .then((response) => {

            this.state.openAIresponse = response.data;
            return this.state.openAIresponse;
         })
         .catch((error) => {
            console.log(error);
         });
    }

    GetPetNamesFake(specieInput) {
        this.state.petSpecie = specieInput;
        axios
         .post(this.state.urlBase + "nlp-pet-name-fake/specie/" + this.state.petSpecie)
         .then((response) => {
            this.state.openAIresponse = response.data;
            console.log(response.data);
         })
         .catch((error) => {
            console.log(error);
         });

        console.log('GetPetNamesFake: '+this.state.openAIresponse);
        return this.state.openAIresponse;
    }
}
export default OpenAINLP;
